script: |
  super -f text -I q4850.spq | sort > q4850.out

inputs:
  - name: q4850.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 NOT BETWEEN + col0 + - ( col0 ) AND - col2 * - ( - - 55 );
  - name: tab2

outputs:
  - name: q4850.out
    data: |
      46	51	23
      64	77	40
      75	67	58
